import React from 'react';
import pass from './password.png';
import {NavLink} from "react-router-dom";
import './Signup.css';

function Signup() {
  return (
    <div className="outer1">
        <div className="inner1">
            <div className="upper">
                <img src={pass} />
                <div className="up"> Pass-Man </div>
            </div>
            <div className="nam11">Sign-Up</div>
            <div className="nam111">Already have an account <NavLink to="/Login">Click here</NavLink></div>
            <input type="text" className="uname1" placeholder="Enter Username" />
            <input type="text" className="pass1" placeholder="Enter Password" />
            <button className="but1">SignUp</button>
        </div>
    </div>
  );
};

export default Signup;
